var mode = 1;
var img1Base64 = `data:image/png;base64,`
var img2Base64 = `data:image/png;base64,`

function change(mode) {
    var elm2 = document.getElementById("mode2");
    var btn1 = document.getElementById("btn1");
    var btn2 = document.getElementById("btn2");
    if (mode == 1) {
        elm2.style.display = "none";
        btn1.className = "btn-active";
        btn2.className = "btn-deactive float-right";
    } else {
        elm2.style.display = "flex";
        btn1.className = "btn-deactive";
        btn2.className = "btn-active float-right";
    }
    document.getElementById("image1").innerHTML = `<h4>Please give a license<br> (Press to start shooting)</h4>`;
    document.getElementById("image2").innerHTML = `<h4>Please give a license<br> (Press to start shooting)</h4>`;
    var btn_anl1 = document.getElementById("anl1");
    btn_anl1.disabled = true;
    btn_anl1.className = "btn-deactive";
    var btn_anl2 = document.getElementById("anl2");
    btn_anl2.disabled = true;
    btn_anl2.className = "btn-deactive";
    render(new Data());
}

function changeToMode1() {
    mode = 1;
    change(mode);
    var user1 = document.getElementById("user1");
    user1.style.opacity = "1";
}


function changeToMode2() {
    mode = 2;
    change(mode);
    var user1 = document.getElementById("user1");
    user1.style.opacity = "0";
}

var toogle1 = 0;

function togglePopup1() {
    toogle1++;
    if (toogle1 === 2) {
        toogle1 = 0;
        document.getElementById("image1").innerHTML = `<img src=${img1Base64}></img>`
    }
    document.getElementById("popup-1").classList.toggle("active");
    var btn_anl1 = document.getElementById("anl1");
    btn_anl1.className = "btn-active btn";
    btn_anl1.disabled = false;

}
var toogle2 = 0;

function togglePopup2() {
    toogle2++;
    if (toogle2 === 2) {
        toogle2 = 0;
        document.getElementById("image2").innerHTML = `<img src=${img2Base64}></img>`
    }
    document.getElementById("popup-2").classList.toggle("active");
    var btn_anl2 = document.getElementById("anl2");
    btn_anl2.className = "btn-active btn";
    btn_anl2.disabled = false;
}


function render(data) {
    var fullname = document.getElementById("fullname");
    var matching = document.getElementById("matching");
    var address = document.getElementById("address");
    var dateOb = document.getElementById("dateOb");
    var dateRange = document.getElementById("dateRange");
    var dateExpiry = document.getElementById("dateExpiry");
    var status = document.getElementById("status");


    matching.innerHTML = data.matching ? data.matching : "";
    fullname.value = data.fullname ? data.fullname : "";
    address.value = data.address ? data.address : "";
    dateOb.value = data.dateOb ? data.dateOb : "";
    dateRange.value = data.dateRange ? data.dateRange : "";
    dateExpiry.value = data.dateExpiry ? data.dateExpiry : "";
    status.value = data.status ? data.status : "";
}

function Data(matching, fullname, address, dateOb, dateRange, dateExpiry, status, percent) {
    this.matching = matching;
    this.fullname = fullname;
    this.address = address;
    this.dateOb = dateOb;
    this.dateRange = dateRange;
    this.dateExpiry = dateExpiry;
    this.status = status;
    this.percent = percent;
}
document.getElementById("img1").src = img1Base64;
document.getElementById("img2").src = img2Base64;

var API = "http://192.168.1.133:8080/api/v1/"

var data1 = { "base64Str": img1Base64 };

function analytic1() {
    if (mode == 1) {
        var url = API + "analytics1";
    } else {
        var url = API + "analytics2";
    }
    axios.post(url, data1)
        .then(function(res) {
            var result = res.data;
            var data = new Data(result.matching, result.fullname, result.address, result.dateOb, result.dateRange, result.dateExpiry, result.status, result.percent);
            render(data);
            console.log(res);
        })
}

var data2 = { "base64Str": img2Base64 };

function analytic2() {
    var url = API + "analytics3";
    axios.post(url, data2)
        .then(function(res) {
            var data = res.data;
            var percent = document.getElementById("percent");
            percent.innerHTML = data.percent ? data.percent + "%" : "";
        })

}